import React from 'react';
import styles from './Header.module.css';

function Header() {
  return (
      <div className={styles.header}>
          <div className={styles.container}>
              {/* eslint-disable-next-line react/jsx-no-undef */}
              <NavMenu />
             
          </div>

      </div>
);
}
export default Header;
